import { ApiProperty } from '@nestjs/swagger';
import { IsString, IsNotEmpty } from 'class-validator';

export class UploadBase64FileDto {
  @ApiProperty({
    example:
      '',
  })
  @IsString()
  @IsNotEmpty()
  uri: string;

  @ApiProperty({ example: 'image/jpeg' })
  @IsString()
  @IsNotEmpty()
  type: string;

  @ApiProperty({ example: 'Winter LotionQPDS Sample Image' })
  @IsString()
  @IsNotEmpty()
  name: string;
}
